/**
 * إنشاء/تحديث جداول الانتخابات الأساسية في قاعدة البيانات.
 *
 * - elections                 : تعريف كل تغطية انتخابية (العنوان، الحالة، إجمالي المقاعد...)
 * - election_parties          : الأحزاب الخاصة بكل تغطية انتخابية
 * - election_regions          : الولايات / المناطق / الأقاليم لكل تغطية
 * - election_results_summary  : ملخص النتائج لكل حزب
 * - election_results_regions  : نتائج كل حزب في كل منطقة
 */
if (!function_exists('gdy_elections_ensure_schema')) {
    function gdy_elections_ensure_schema(PDO $pdo): void
    {
        try {
            // ===== جدول الانتخابات الأساسي =====
            $pdo->exec("
                CREATE TABLE IF NOT EXISTS elections (
                    id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
                    title VARCHAR(255) NOT NULL,
                    slug  VARCHAR(255) NOT NULL UNIQUE,
                    description TEXT NULL,
                    total_seats INT UNSIGNED NULL,
                    majority_seats INT UNSIGNED NULL,
                    status ENUM('visible','hidden','archived') NOT NULL DEFAULT 'hidden',
                    created_at DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
                    updated_at DATETIME NULL,
                    INDEX idx_status (status)
                ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
            ");

            // التأكد من وجود الأعمدة الجديدة (عند الترقية من إصدار قديم)
            try {
                $cols = [];
                $stmtCols = gdy_db_stmt_columns($pdo, 'elections');
                if ($stmtCols) {
                    $cols = $stmtCols->fetchAll(PDO::FETCH_COLUMN, 0);
                }

                if ($cols && !in_array('total_seats', $cols, true)) {
                    $pdo->exec("ALTER TABLE elections ADD COLUMN total_seats INT UNSIGNED NULL AFTER description");
                }
                if ($cols && !in_array('majority_seats', $cols, true)) {
                    $pdo->exec("ALTER TABLE elections ADD COLUMN majority_seats INT UNSIGNED NULL AFTER total_seats");
                }
            } catch (\Throwable $e) {
                error_log('[Godyar Elections] alter elections columns error: ' . $e->getMessage());
            }

            // ===== جدول الأحزاب =====
            $pdo->exec("
                CREATE TABLE IF NOT EXISTS election_parties (
                    id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
                    election_id INT UNSIGNED NOT NULL,
                    code VARCHAR(32) DEFAULT NULL,
                    short_name VARCHAR(64) NOT NULL,
                    full_name VARCHAR(255) DEFAULT NULL,
                    color_hex VARCHAR(9) DEFAULT NULL,
                    logo_path VARCHAR(255) DEFAULT NULL,
                    sort_order INT UNSIGNED NOT NULL DEFAULT 0,
                    created_at DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
                    updated_at DATETIME NULL,
                    CONSTRAINT fk_election_parties_election
                        FOREIGN KEY (election_id) REFERENCES elections(id)
                        ON DELETE CASCADE,
                    INDEX idx_election_parties_election (election_id),
                    INDEX idx_election_parties_sort (election_id, sort_order)
                ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
            ");

            // ===== جدول المناطق / الولايات =====
            $pdo->exec("
                CREATE TABLE IF NOT EXISTS election_regions (
                    id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
                    election_id INT UNSIGNED NOT NULL,
                    parent_id INT UNSIGNED DEFAULT NULL,
                    name_ar VARCHAR(255) NOT NULL,
                    name_en VARCHAR(255) DEFAULT NULL,
                    slug VARCHAR(255) DEFAULT NULL,
                    map_code VARCHAR(64) DEFAULT NULL,
                    total_seats INT UNSIGNED DEFAULT 0,
                    sort_order INT UNSIGNED NOT NULL DEFAULT 0,
                    created_at DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
                    updated_at DATETIME NULL,
                    CONSTRAINT fk_election_regions_election
                        FOREIGN KEY (election_id) REFERENCES elections(id)
                        ON DELETE CASCADE,
                    CONSTRAINT fk_election_regions_parent
                        FOREIGN KEY (parent_id) REFERENCES election_regions(id)
                        ON DELETE SET NULL,
                    INDEX idx_election_regions_election (election_id),
                    INDEX idx_election_regions_slug (election_id, slug),
                    INDEX idx_election_regions_map (election_id, map_code)
                ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
            ");

            // ===== جدول الملخص العام لكل حزب =====
            $pdo->exec("
                CREATE TABLE IF NOT EXISTS election_results_summary (
                    id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
                    election_id INT UNSIGNED NOT NULL,
                    party_id INT UNSIGNED NOT NULL,
                    seats_won INT UNSIGNED NOT NULL DEFAULT 0,
                    seats_leading INT UNSIGNED NOT NULL DEFAULT 0,
                    votes BIGINT UNSIGNED DEFAULT NULL,
                    vote_percent DECIMAL(5,2) DEFAULT NULL,
                    last_updated DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
                    CONSTRAINT fk_results_summary_election
                        FOREIGN KEY (election_id) REFERENCES elections(id)
                        ON DELETE CASCADE,
                    CONSTRAINT fk_results_summary_party
                        FOREIGN KEY (party_id) REFERENCES election_parties(id)
                        ON DELETE CASCADE,
                    UNIQUE KEY uq_results_summary (election_id, party_id),
                    INDEX idx_results_summary_rank (election_id, seats_won, seats_leading)
                ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
            ");

            // ===== جدول النتائج حسب المنطقة / الولاية =====
            $pdo->exec("
                CREATE TABLE IF NOT EXISTS election_results_regions (
                    id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
                    election_id INT UNSIGNED NOT NULL,
                    region_id INT UNSIGNED NOT NULL,
                    party_id INT UNSIGNED NOT NULL,
                    seats_won INT UNSIGNED NOT NULL DEFAULT 0,
                    seats_leading INT UNSIGNED NOT NULL DEFAULT 0,
                    votes BIGINT UNSIGNED DEFAULT NULL,
                    vote_percent DECIMAL(5,2) DEFAULT NULL,
                    last_updated DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
                    CONSTRAINT fk_results_region_election
                        FOREIGN KEY (election_id) REFERENCES elections(id)
                        ON DELETE CASCADE,
                    CONSTRAINT fk_results_region_region
                        FOREIGN KEY (region_id) REFERENCES election_regions(id)
                        ON DELETE CASCADE,
                    CONSTRAINT fk_results_region_party
                        FOREIGN KEY (party_id) REFERENCES election_parties(id)
                        ON DELETE CASCADE,
                    UNIQUE KEY uq_results_region (election_id, region_id, party_id),
                    INDEX idx_results_region_region (region_id),
                    INDEX idx_results_region_party (party_id)
                ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
            ");
        } catch (\Throwable $e) {
            error_log('[Godyar Elections] ensure schema error: ' . $e->getMessage());
        }
    }
}

if (!function_exists('gdy_elections_status_label')) {
    /**
     * تحويل قيمة status إلى نص عربي + كلاس Bootstrap
     */
    function gdy_elections_status_label(string $status): array
    {
        switch ($status) {
            case 'visible':
                return ['label' => __('t_2973521e00', 'ظاهر على الموقع'), 'class' => 'success'];
            case 'archived':
                return ['label' => __('t_2e67aea8ca', 'مؤرشف'), 'class' => 'secondary'];
            case 'hidden':
            default:
                return ['label' => __('t_a39aacaa71', 'مخفي'), 'class' => 'warning'];
        }
    }
}

if (!function_exists('gdy_elections_slugify')) {
    /**
     * إنشاء slug بسيط يدعم العربية
     */
    function gdy_elections_slugify(string $str): string
    {
        $str = trim($str);
        // استبدال أي شيء غير حروف/أرقام عربية/لاتينية بشرطة
        $str = preg_replace('/[^\p{Arabic}a-zA-Z0-9]+/u', '-', $str);
        $str = trim($str, '-');
        if ($str === '') {
            $str = 'election-' . bin2hex(random_bytes(3));
        }
        if (function_exists('mb_strtolower')) {
            return mb_strtolower($str, 'UTF-8');
        }
        return strtolower($str);
    }
}

